import './App.css';
//import {BrowserRouter as Router, Routes, Route, } from "react-router-dom"
//import SingleProduct from './Pages/SingleProduct/SingleProduct';
import Navbar from './Components/Navbar/Navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Shop from './Pages/Shop';
import ShopCategory from './Pages/ShopCategory';
import Product from './Pages/Product';
import Cart from './Pages/Cart';
import LoginSignup from './Pages/LoginSignup';
import Footer from './Components/Footer/Footer';
import men_banner from './Components/Assets/banner_mens.png'
import women_banner from './Components/Assets/banner_women.png'
import kid_banner from './Components/Assets/banner_kids.png'
import Register from './Components/Account/Register';

function App() {
  return (
 <div>
  <BrowserRouter>
 <Navbar/>
 <Routes>
  <Route path='/' element={<Shop/>}/>
  <Route path='/school' element={<ShopCategory banner={men_banner} category="men"/>}/>
  <Route path='/college' element={<ShopCategory banner={women_banner} category="women"/>}/>
  <Route path='/kindergarden' element={<ShopCategory banner={kid_banner} category="kid"/>}/>
  <Route path='/product/:productId' element={<Product/>}/>
  <Route path='/cart' element={<Cart/>}/>
  <Route path='/login' element={<LoginSignup/>}/>
  <Route path='/register' Component={Register}/>
 </Routes>
 <Footer/>
 </BrowserRouter>
 </div>
  );
}

export default App;
